import React from 'react';
import './Profile.css';

function Profile() {
    return (
        <div className="profile">
            <h2 className="profile-title">Привет, Андрей!</h2>
            <form className="profile__form">
                <fieldset className="profile__name">
                    <label className="profile__label">Имя</label>
                    <input type="text" name="name" className="profile__input" minLength="2" maxLength="30" placeholder="Андрей" required />
                </fieldset>
                <fieldset className="profile__email">
                    <label className="profile__label">E-mail</label>
                    <input type="email" name="name" className="profile__input" placeholder="adm.az-an@yandex.ru" required />
                </fieldset>
            </form>
        </div>
    )
}

export default Profile;
